  {comment_id: "5311809", shot_id: 38, comment_created_at: "2016-05-31T09:13:35Z", body: "<p>Nice idea. I could use something like this! Apple and Microsoft are really well placed to take advantage of this kind of pro feature. A while ago this keyboard with a somewhat similar idea was floating around &gt; <a href=\"https://www.wikiwand.com/en/Optimus_Maximus_keyboard\" rel=\"noreferrer\">https://www.wikiwand.com/en/Optimus_Maximus_keyboard</a>\n<br />Never got off the ground though.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/150542/avatars/normal/72886c234d985c0df80ae24cf77ee66c.jpg?1448646646", user_id: "150542", user_name: "Chris", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 5980, localcommentimage_updated_at: "2016-05-31 09:58:24"},
