  {comment_id: "5313702", shot_id: 61, comment_created_at: "2016-05-31T20:01:39Z", body: "<p><a href=\"https://dribbble.com/699278\">@Daniel Belu</a> agreed ‚Äîwithout the mane, the shape of the head and neck isn't obviously not a cat, dog, ect.</p>\n\n<p>I don't think it's hurting anything from the standpoint of the geometry either because the magic of the negative space is happening on the inside of the neck and chin</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/39609/avatars/normal/d6e51265403f3fcc8906001b8dd0a43f.jpg?1413259546", user_id: "39609", user_name: "Dan Lehman", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 588, localcommentimage_updated_at: "2016-06-01 00:27:01"},
