  {comment_id: "5314037", shot_id: 61, comment_created_at: "2016-05-31T23:21:32Z", body: "<p><a href=\"https://dribbble.com/569739\">@Aleksandar Mitiƒá</a> <a href=\"https://dribbble.com/700730\">@Gary Wilkerson</a> <a href=\"https://dribbble.com/295355\">@Jordan Jenkins</a> <a href=\"https://dribbble.com/39609\">@Dan Lehman</a> <a href=\"https://dribbble.com/5976\">@Alex Tass</a> <a href=\"https://dribbble.com/699278\">@Daniel Belu</a> <a href=\"https://dribbble.com/819249\">@Mario Ronci</a> Huge thanks to you all, I am very glad you like it! </p>\n\n<p>Also thanks to the additional notes, the mark stands alone as well as stands together with the naming in order to compliment each other, I believe there should be no worries regarding breaking the geometries. Cheers!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/67172/avatars/normal/driblui..jpg?1354816470", user_id: "67172", user_name: "Julius Seni≈´nas", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 2259, localcommentimage_updated_at: "2016-06-01 00:27:02"},
