  {comment_id: "5316073", shot_id: 82, comment_created_at: "2016-06-01T14:05:22Z", body: "<p>Those smoke plumes in the back are beautiful.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/228577/avatars/normal/926baa667d9b23de6587329d3f9d3c8b.jpg?1452751792", user_id: "228577", user_name: "Andrew Washuta", localcommentimage_file_name: "open-uri20160601-60894-yr2fsi", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 60156, localcommentimage_updated_at: "2016-06-01 18:52:18"},
  {comment_id: "5316131", shot_id: 82, comment_created_at: "2016-06-01T14:21:38Z", body: "<p>Style is very nice but the ground tone (F8E1AB )is really messing with the depth perception, try to use something more neutral...</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/752006/avatars/normal/ca9819245a17a0286735fd6d081407a6.png?1447683391", user_id: "752006", user_name: "Boaz Lederer", localcommentimage_file_name: "data", localcommentimage_content_type: "image/png", localcommentimage_file_size: 9243, localcommentimage_updated_at: "2016-06-01 18:52:18"},
  {comment_id: "5316201", shot_id: 82, comment_created_at: "2016-06-01T14:35:37Z", body: "<p><a href=\"https://dribbble.com/693064\">@Ryan Prudhomme</a> <a href=\"https://dribbble.com/14700\">@Justin Gammon</a> <a href=\"https://dribbble.com/228577\">@Andrew Washuta</a> Thanks guys! I'm glad you like it!\n<br /><a href=\"https://dribbble.com/752006\">@Boaz Lederer</a> Thank you for advice! I'll already thought about changing the palette a bit. Will try to separate enemies and important parts of the gameplay from the background.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/720504/avatars/normal/db8f1804636aa2599d046dfeb5a5b617.png?1446121166", user_id: "720504", user_name: "July Pluto", localcommentimage_file_name: "open-uri20160601-60894-w63hy7", localcommentimage_content_type: "image/png", localcommentimage_file_size: 13291, localcommentimage_updated_at: "2016-06-01 18:52:18"},
  {comment_id: "5316246", shot_id: 82, comment_created_at: "2016-06-01T14:47:43Z", body: "<p>I like it but it has no hierarchy of the elements. My eyes are all over the place trying to distinguish between what is interactive and what's the background. Just my 2 cents, I'm not trying to be mean!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/114075/avatars/normal/8d0e9082df87d118c5758739b43a8a39.png?1442910051", user_id: "114075", user_name: "Emanuel Serbanoiu ", localcommentimage_file_name: "open-uri20160601-60894-18i9fty", localcommentimage_content_type: "image/png", localcommentimage_file_size: 41386, localcommentimage_updated_at: "2016-06-01 18:52:18"},
  {comment_id: "5316459", shot_id: 82, comment_created_at: "2016-06-01T15:46:53Z", body: "<p>This style is beyond epic and I agree with <a href=\"https://dribbble.com/693064\">@Ryan Prudhomme</a> I would play this in a heartbeat! </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/295355/avatars/normal/09f925d4151a3b9db8a74ad5f53e0af3.png?1464264982", user_id: "295355", user_name: "Jordan Jenkins", localcommentimage_file_name: "open-uri20160601-60894-151jvix", localcommentimage_content_type: "image/png", localcommentimage_file_size: 18706, localcommentimage_updated_at: "2016-06-01 18:52:19"},
