  {title: "Contact List Concept Scrolls", description: "<p>Hello dribbblers! Thanks a lot for such a warm greeting for my debut shot earlier. Today, as it was promised, I would like to present you the animated version of the user interface for a contact list app. It features variants of vertical and horizontal scroll as well as other interactions with the application. Your feedback is highly appreciated!</p>\n\n<p><strong>Designing user interfaces for websites and mobile applications here in <a href=\"http://tubikstudio.com\" rel=\"nofollow noreferrer\">Tubik Studio</a>, we have frequently checked how powerful the choice of color palette and effective background is for usability and visual harmony of a product. You can find some of our ideas about <a href=\"http://tubikstudio.com/dark-side-of-ui-benefits-of-dark-background/\" rel=\"nofollow noreferrer\">efficiency of dark background</a> in UI in <a href=\"http://tubikstudio.com/blog/\" rel=\"nofollow noreferrer\">Tubik Blog</a>. Inspiring day to you all! </strong></p>\n\n<p><a href=\"https://www.behance.net/Tubik\" rel=\"nofollow noreferrer\">Behance</a> | <a href=\"http://instagram.com/tubikstudio\" rel=\"nofollow noreferrer\">Instagram</a> | <a href=\"https://twitter.com/tubikstudio\" rel=\"nofollow noreferrer\">Twitter</a> | <a href=\"https://www.facebook.com/tubikstudio\" rel=\"nofollow noreferrer\">Facebook</a> | <a href=\"https://plus.google.com/+Tubikstudio\" rel=\"nofollow noreferrer\">Google+</a> | <a href=\"http://tubikstudio.com/\" rel=\"nofollow noreferrer\">Tubik</a></p>", width: "400", height: "300", tags: "[\"concept\", \"contact list\", \"ios\", \"tubik\", \"ui\"]", image_url: nil, image_path: nil, user_id: 16, viewcount: 2271, likes_count: 150, comments_count: 6, attachments_count: 0, rebounds_count: 0, buckets_count: 11, dribbble_id: 2745648, html_url: "https://dribbble.com/shots/2745648-Contact-List-Concept-Scrolls", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2745648/buc